import { useLoaderData } from "react-router-dom";
function Libros(){
    let _libros = useLoaderData();
    return (
        <div>
          {_libros.map((libro) => (
            <div key={libro.IdCategoria}>
                <h1>Libro</h1>
            </div>
          ))}
        </div>
      );
}
export default Libros;
